import './App.css';

const App = () => {
  return (
    <div className="App">
      Simple HTML
      <ul>
        <li>HTML</li>
        <li>CSS</li>
        <li>JavaScript</li>
        <li>React.js</li>
      </ul>
    </div>
  );
}

export default App;
